import React from 'react'

const Blogger = () => {
  return (
    <div>
      <h1 className="text-center text-white">Blogger's Mela</h1>
      <h3 className="text-center text-white">Bloggers who have worked with us!</h3>

    </div>
  )
}

export default Blogger
